import numpy as np
from shapely.geometry import Point, Polygon
from del_bbox import drop_inside_bboxes

def trans_box(boxes,full_boxes=True):
    '''
    full_boxes means a list of box
    input:
        [[7.69001038e+02 1.44156030e+03 8.20211121e+02 1.48525391e+03 6.36455059e-01]
            [8.27617493e+02 1.53489282e+03 9.54969788e+02 1.62012524e+03 8.95488933e-02]]
    output:
        [[(769.001038, 1441.5603),(820.211121, 1441.5603),
          (769.001038, 1485.25391),(820.211121, 1485.25391)],
         [(827.617493, 1534.89282),(954.969788, 1534.89282),
          (827.617493, 1620.12524),(954.969788, 1620.12524)]]
    '''
    if full_boxes:
        boxes_4cords = []
        for box in boxes:
            box_i = []
            pts = box[:4]
            xmin,ymin,xmax,ymax = pts[0],pts[1],pts[2],pts[3]
            # p1=(pts[0],pts[1])
            # p2=(pts[2],pts[1])
            # p3=(pts[0],pts[3])
            # p4=(pts[2],pts[3])

            p1=(xmin,ymin)
            p2=(xmax,ymin)
            p3=(xmax,ymax)
            p4=(xmin,ymax)

            box_i.append(p1)
            box_i.append(p2)
            box_i.append(p3)
            box_i.append(p4)
            boxes_4cords.append(box_i)
        return boxes_4cords
    else:
        box_i = []
        pts = boxes[:4]
        xmin,ymin,xmax,ymax = pts[0],pts[1],pts[2],pts[3]
        p1=(xmin,ymin)
        p2=(xmax,ymin)
        p3=(xmax,ymax)
        p4=(xmin,ymax)
        box_i.append(p1)
        box_i.append(p2)
        box_i.append(p3)
        box_i.append(p4)
        return box_i

def calculate_intersection(coords_big,coords2_small,theath=0.3):
    # cords = trans_box(coords2_small,full_boxes=False)
    p1 = Polygon(coords_big)
    p2 = Polygon(coords2_small)
    inter_sec_area = p1.intersection(p2).area
    overlap1 = inter_sec_area/p1.area
    overlap2 = inter_sec_area/p2.area
    if overlap1 > overlap2:
        overlap = overlap1
    else:
        overlap = overlap2
    if overlap > theath:
        return 'True'
    else:
        return 'False'

def get_center_pt(bbox):
    xmin,ymin,xmax,ymax = int(bbox[0]), int(bbox[1]), int(bbox[2]), int(bbox[3])
    heiht = ymax-ymin
    width = xmax-xmin
    final_y = ymin+heiht*0.5
    final_x = xmin+width*0.5
    return final_y,final_x

def locate_box(img_path,boxes,QiGuan_return):
    Xinying_box = QiGuan_return['xinying_box']
    xinying_contour = QiGuan_return['XinYin_contour']
    fei0_contour = QiGuan_return['fei0_contour']
    fei1_contour = QiGuan_return['fei1_contour']
    xinying_xmin,xinying_ymin,xinying_xmax,xinying_ymax = Xinying_box[0],Xinying_box[1],Xinying_box[2],Xinying_box[3]
    xinying_height = xinying_ymax-xinying_ymin
    xinying_width = xinying_xmax-xinying_xmin
    xinying_theather_line_y = xinying_ymin + xinying_height*0.45
    xinying_theather_line_x = xinying_xmin + xinying_width*0.5

    boxes_4cords = trans_box(boxes,full_boxes=True)
    str_box = []
    im = cv2.imread(img_path)
    cv2.rectangle(im, (xinying_xmin,xinying_ymin), (xinying_xmax,xinying_ymax), (255,0,0), 5)
    cv2.line(im, (int(xinying_xmin), int(xinying_theather_line_y)), (int(xinying_xmax), int(xinying_theather_line_y)), (0,250,0), 5)
    cv2.line(im, (int(xinying_theather_line_x), int(xinying_theather_line_y)), (int(xinying_theather_line_x), int(xinying_ymax)), (0,0,250), 5)


    for i in range(len(boxes_4cords)):
        TorF_fei0 = calculate_intersection(fei0_contour,boxes_4cords[i],theath=0.7)
        TorF_fei1 = calculate_intersection(fei1_contour,boxes_4cords[i],theath=0.7)
        if TorF_fei0 == 'True' or TorF_fei1 == 'True':
            str_box.append('GaiHua_Fei')
        else:
            TorF_xinying = calculate_intersection(xinying_contour,boxes_4cords[i],theath=0.7)
            if TorF_xinying == 'True':
                box_center_y,box_center_x = get_center_pt(boxes[i])
                pts = boxes[i]
                xmin,ymin,xmax,ymax = pts[0],pts[1],pts[2],pts[3]
                cv2.rectangle(im, (int(xmin),int(ymin)), (int(xmax),int(ymax)), (255,0,0), 2)
                cv2.circle(im,(int(box_center_x), int(box_center_y)), 5, (0,0,255),-1)
                # print('box_center_y',box_center_y)
                # print('xinying_theather_line_y',xinying_theather_line_y)
                if box_center_y < xinying_theather_line_y:
                    str_box.append('GaiHua_XinYin_up')
                else:
                    if box_center_x > xinying_theather_line_x:
                        str_box.append('GaiHua_XinYin_down_large_x')
                    else:
                        str_box.append('GaiHua_XinYin_down_small_x')
            else:
                str_box.append('GaiHua_not_XinYin_Fei')
    cv2.imwrite('/home/steven/mask_rcnn_caffe2/Detectron-xRay/Wrapper/DR_Wrappers/GaiHua_draw.jpg',im,[int(cv2.IMWRITE_JPEG_QUALITY), 30])
    return str_box

def combine(img_path,FeiGaiHua_box=None,FeiGaiHua_cls=None,XGBGaiHua_box=None,XGBGaiHua_cls=None,QiGuan_return=None):
    if not FeiGaiHua_box:
        FeiGaiHua_box = [[0, 0, 10, 10, 0.3]]
    if not FeiGaiHua_cls:
        FeiGaiHua_cls = ['Fei_JJ']
    if not XGBGaiHua_box:
        XGBGaiHua_box = [[0, 0, 10, 10, 0.3]]
    if not XGBGaiHua_cls:
        XGBGaiHua_cls = ['Fei_GaiHua']

    new_box,new_cls = [],[]
    for box in FeiGaiHua_box:
        new_box.append(box)
    for box in XGBGaiHua_box:
        new_box.append(box)
    # for str in FeiGaiHua_cls:
    #     new_cls.append('GaiHua0')
    #     # print('new_cls',new_cls)
    # for str in XGBGaiHua_cls:
    #     new_cls.append('GaiHua1')

    new_cls = locate_box(img_path,new_box,QiGuan_return)
    new_box,new_cls = drop_inside_bboxes(new_box,new_cls)
    return new_box,new_cls

